private static int getLookupIndex(String theWord, String[] lookupArray) {
  String lookupCharacters = theWord.substring(theWord.length() - 2);
  int lookupIndex = Arrays.asList(lookupArray).indexOf(lookupCharacters);
  return lookupIndex;
}
